import React, { useState, useEffect } from 'react'

const ScheduleBooking = () => {
    const [monthData, setMonthData] = useState([]);
    const [displayedData, setDisplayedData] = useState([]);
    const [startIndex, setStartIndex] = useState(0);

    useEffect(() => {
        // Get the current date
        const currentDate = new Date();

        // Calculate the date of 1 month later
        const oneMonthLaterDate = new Date(currentDate);

        oneMonthLaterDate.setMonth(oneMonthLaterDate.getMonth() + 1);

        const data = [];
        let currentDateIterator = new Date(currentDate);

        while (currentDateIterator <= oneMonthLaterDate) {
            data.push({
                date: new Date(currentDateIterator),
            });
            currentDateIterator.setDate(currentDateIterator.getDate() + 1);
        }
        setMonthData(data);
        setDisplayedData(data.slice(startIndex, startIndex + 3));
    }, [startIndex]);


    const handleNextClick = () => {
        if (startIndex + 3 < monthData.length) {
            setStartIndex(startIndex + 3);


        }
    };
    const handlePreviewClick = () => {
        if (startIndex - 3 >= 0) {
            setStartIndex(startIndex - 3);
        }
    };
    const [selectedDate, setSelectedDate] = useState(null);
    const [selectedTime, setSelectedTIme] = useState(null);
    const [isButtonClicked, setButtonClicked] = useState(false);

    const handleDateClick = (selectedDate) => {
        setSelectedDate(selectedDate);
        setButtonClicked(true)
        console.log(selectedDate);
        console.log(isButtonClicked + 'yes');

    };
    const handleTimeClick = (selectedTime) => {
        setSelectedTIme(selectedTime);
        setButtonClicked(true)
        console.log(selectedTime);

    };


    return (
        <>
            <div className='d-flex justify-content-center flex-column  mt-5 m-3'>
                <div className='d-flex mx-auto '>
                    <h1>Appointment Booking</h1>
                </div>
                <div className='d-flex border mx-auto border-secondary m-2 justify-content-between p-2 align-items-center gap-2 ' style={{ width: '70vw' }}>
                    <button style={{ width: '6vw', height: '5vh' }} className='btn btn-outline-dark' onClick={handlePreviewClick} disabled={startIndex === 0}> Preview </button>
                    {displayedData.map((item, index) => (
                        <button onClick={() => handleDateClick(item.date.toLocaleDateString())} key={index} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }} >
                            {item.date.toLocaleDateString()}
                        </button>
                    ))}
                    <button style={{ width: '6vw', height: '5vh' }} className='btn btn-outline-dark' onClick={handleNextClick} disabled={startIndex + 3 >= monthData.length}>Next</button>
                </div>
            </div >

            <div className='d-flex justify-content-center flex-column align-items-centerm'>
                <div className='d-flex border mx-auto border-secondary  flex-wrap justify-content-evenly m-2 flex-wrap p-2 align-items-center gap-2' style={{ width: '70vw' }}>
                    <button onClick={() => handleTimeClick('10:00AM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>10:00AM</button>
                    <button onClick={() => handleTimeClick('10:30AM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>10:30AM</button>
                    <button onClick={() => handleTimeClick('11:00AM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>11:00AM</button>
                    <button onClick={() => handleTimeClick('11:30AM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>11:30PM</button>
                    <button onClick={() => handleTimeClick('12:00PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>12:00PM</button>
                    <button onClick={() => handleTimeClick('12:30PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>12:30PM</button>
                    <button onClick={() => handleTimeClick('01:00PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>01:00PM</button>
                    <button onClick={() => handleTimeClick('01:30PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>01:30PM</button>
                    <button onClick={() => handleTimeClick('02:00PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>02:00PM</button>
                    <button onClick={() => handleTimeClick('02:30PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>02:30PM</button>
                    <button onClick={() => handleTimeClick('03:00PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>03:00PM</button>
                    <button onClick={() => handleTimeClick('03:30PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>03:30PM</button>
                    <button onClick={() => handleTimeClick('04:00PM')} style={{ background: isButtonClicked ? 'green' : 'white', width: '15vw', border: '1px solid black', borderRadius: '4px', padding: '5px' }}>04:00PM</button>
                </div>
            </div>
        </>
    )
}

export default ScheduleBooking
